import logo from './logo.svg';
import './App.css';
import data from './data';
import Display from './Display';

function App() {

  console.log(Display);
  function printConsole(){
    data.forEach(function(item) {
      console.log(item.name, item.price, item.pictures);
      console.log(item.seller);
      console.log(item.location);
      console.log(item.rate);
    })
  };
  printConsole();
  return (
    <div className="App">
      <div>
        <Display name={data[0].name} price={data[0].price}/>
      </div>
      <div>
        <Display name={data[1].name} price={data[1].price}/>
      </div>
      <div>
        <Display name={data[2].name} price={data[2].price}/>
      </div>
    </div>
  );
}

export default App;
